export default function SingleResult({ artist }) {
  return (
    <div className="result-container">
      <div className="image-wrapper">
        <img
          src={artist.images.length > 0 ? artist.images[1].url : null}
          alt=""
        />
      </div>
      <h2>{artist.name}</h2>
    </div>
  );
}
